// colorString : hexColor -> rgba
var colorString = function(aColor) {
  return "rgba(" + colorRed(aColor) + "," +
                  colorGreen(aColor) + ", " +
                  colorBlue(aColor) + ", " +
                  (colorAlpha(aColor) || 255)/255.0 + ")";
};




